// Description helpers
const mortality = (age) => "Year of mortality: " + age
const cumulativeDefoliation3 = (age) => "Year of cummulative defoliation: " + age
const noDescription = (age) => age


const mapLayers = [
  { name: 'North Bay Polygons', data: northBayPolygons, dataName: 'northBayPolygons', description: noDescription, type: 'fill' },
  { name: 'Dryden Polygons', data: drydenPolygon, dataName: 'drydenPolygon', description: noDescription, type: 'fill' },
  { name: 'Timmins Polygons', data: timminsPolygon, dataName: 'timminsPolygon', description: noDescription, type: 'fill' },
  { name: 'Dryden Plots', data: drydenPlots, dataName: 'drydenPlots', description: noDescription, type: 'circle' },
  { name: 'North Bay Plots', data: northBayPlots, dataName: 'northBayPlots', description: noDescription, type: 'circle' },
  { name: 'Timmins Plots', data: timminsPlots, dataName: 'timminsPlots', description: noDescription, type: 'circle' },
]

// ################################################################

var colourArray = ['match', ['get', "EVENT_YEAR"],]

for (const colour of fillColours) {
  const legendDiv = document.createElement('div')
  const legendSpan = document.createElement('span')
  const legendText = document.createTextNode(colour.year)
  legendSpan.style.cssText = "background-color: " + colour.colour
  legendDiv.appendChild(legendSpan)
  legendDiv.appendChild(legendText)
  document.getElementById('year-legend').appendChild(legendDiv)
  colourArray.push(colour.year)
  colourArray.push(colour.colour)
}

colourArray.push("blue")

var map = new mapboxgl.Map({
  container: 'map',
  style: 'mapbox://styles/mapbox/outdoors-v11',
  center: [-82.48, 48.6],
  zoom: 6,
  logoPosition: "top-right",
  attributionControl: false
});

function addMapLayer(layer) {
  map.addSource(layer.dataName, {
    type: 'geojson',
    'data': layer.data,
  });

  map.on('click', layer.name, (e) => {
    const age = e.features[0].properties.layer;
    new mapboxgl.Popup()
      .setLngLat(e.lngLat)
      .setHTML(layer.description(age))
      .addTo(map);
  });


  map.on('mouseover', layer.name, () => {
    map.getCanvas().style.cursor = 'pointer';
  });

  map.on('mouseleave', layer.name, () => {
    map.getCanvas().style.cursor = 'crosshair';
  });

  if (layer.type == "fill"){
    map.addLayer({
      id: layer.name,
      type: "fill",
      source: layer.dataName,
      'layout': {
        'visibility': 'visible',
      },
      'paint': {
        // this specifies how we style our data
        'fill-color': colourArray,
        'fill-opacity': 0.5
      }
    })
  } else {
    map.addLayer({
      id: layer.name,
      type: "circle",
      source: layer.dataName,
      'layout': {
        'visibility': 'visible',
      },
      'paint': {
        // this specifies how we style our data
        'circle-color': '#F44336',
      }
    })
  }
}

map.on('load', function () {
  for (const layer of mapLayers) {
    addMapLayer(layer)
  }
}); // end map.on('load') 

// After the last frame rendered before the map enters an "idle" state.
map.on('idle', () => {
  // If these two layers were not added to the map, abort
  if (!map.getLayer(mapLayers[mapLayers.length - 1].name)) {
    return;
  }

  // Set up the corresponding toggle button for each layer.
  for (const layer of mapLayers) {
    // Skip layers that already have a button set up.
    if (document.getElementById(layer.name)) {
      continue;
    }

    // Create a link.
    const link = document.createElement('a');
    link.id = layer.name;
    link.href = '#';
    link.textContent = layer.name;
    link.className = 'active';

    // Show or hide layer when the toggle is clicked.
    link.onclick = function (e) {
      const clickedLayer = this.textContent;
      e.preventDefault();
      e.stopPropagation();

      const visibility = map.getLayoutProperty(
        clickedLayer,
        'visibility'
      );

      // Toggle layer visibility by changing the layout object's visibility property.
      if (visibility === 'visible') {
        map.setLayoutProperty(clickedLayer, 'visibility', 'none');
        this.className = '';
      } else {
        this.className = 'active';
        map.setLayoutProperty(
          clickedLayer,
          'visibility',
          'visible'
        );
      }
    };

    const layers = document.getElementById('menu');
    layers.appendChild(link);
  }
});

if (SHOWDISTANCEMEASURE) {
  const distanceContainer = document.getElementById('distance');

  // GeoJSON object to hold our measurement features
  const geojson = {
    'type': 'FeatureCollection',
    'features': []
  };

  // Used to draw a line between points
  const linestring = {
    'type': 'Feature',
    'geometry': {
      'type': 'LineString',
      'coordinates': []
    }
  };

  map.on('load', () => {
    map.addSource('geojson', {
      'type': 'geojson',
      'data': geojson
    });

    // Add styles to the map
    map.addLayer({
      id: 'measure-points',
      type: 'circle',
      source: 'geojson',
      paint: {
        'circle-radius': 5,
        'circle-color': '#000'
      },
      filter: ['in', '$type', 'Point']
    });
    map.addLayer({
      id: 'measure-lines',
      type: 'line',
      source: 'geojson',
      layout: {
        'line-cap': 'round',
        'line-join': 'round'
      },
      paint: {
        'line-color': '#000',
        'line-width': 2.5
      },
      filter: ['in', '$type', 'LineString']
    });

    map.on('mouseover', 'measure-points', () => {
      map.getCanvas().style.cursor = 'pointer';
    });

    map.on('mouseleave', 'measure-points', () => {
      map.getCanvas().style.cursor = 'crosshair';
    });

    map.on('click', (e) => {
      const features = map.queryRenderedFeatures(e.point, {
        layers: ['measure-points']
      });

      // Remove the linestring from the group
      // so we can redraw it based on the points collection.
      if (geojson.features.length > 1) geojson.features.pop();

      // Clear the distance container to populate it with a new value.
      distanceContainer.innerHTML = '';

      // If a feature was clicked, remove it from the map.
      if (features.length) {
        const id = features[0].properties.id;
        geojson.features = geojson.features.filter(
          (point) => point.properties.id !== id
        );
      } else {
        const point = {
          'type': 'Feature',
          'geometry': {
            'type': 'Point',
            'coordinates': [e.lngLat.lng, e.lngLat.lat]
          },
          'properties': {
            'id': String(new Date().getTime())
          }
        };

        geojson.features.push(point);
      }

      if (geojson.features.length > 1) {
        linestring.geometry.coordinates = geojson.features.map(
          (point) => point.geometry.coordinates
        );

        geojson.features.push(linestring);

        // Populate the distanceContainer with total distance
        const value = document.createElement('pre');
        const distance = turf.length(linestring);
        value.textContent = `Total distance: ${distance.toLocaleString()}km`;
        distanceContainer.appendChild(value);
      }

      map.getSource('geojson').setData(geojson);
    });
  });
}

